      (function () {
        var v = document.getElementById('vsc');
        var t, a;
        v.addEventListener(
          'mouseenter',
          function () {
            t = setTimeout(function () {
              if (!a) {
                a = true;
                var e = new Audio('assets/misc/visualstudiocode.mp3');
                e.play();
                e.addEventListener(
                  'ended',
                  function () {
                    a = false;
                  },
                  false
                );
              }
            }, 1000);
          },
          false
        );
        v.addEventListener(
          'mouseleave',
          function () {
            clearTimeout(t);
          },
          false
        );
      })();
